import PropTypes from 'prop-types'; 


export class TodoItem extends Component {
    render() {

      return (
          <div style={itemStyle}>
            <p>{this.props.todo.title}</p>
          </div>

      )
    }
  }

// Prop Types
  TodoItem.PropTypes = {
    todo : PropTypes.object.isRequired
}

const itemStyle = {
  backgroundColor: '#eee'
}

  export default TodoItem;
